import request from "./api";
const type="CONTACT_CONTENT_DATA_SUCCESS"
export function contactContentDataSuccess(contact) {
    return {
        type: type,
        payload: contact
    }
}
export const contactContentData =  (url) => async dispatch => {
    const res = await request.get(url)
    dispatch(contactContentDataSuccess(res.data))
}
